import React from "react";
import "./Chatting.css";
import NavTop from "./NavTop/NavTop";
import NavTop2 from "./NavTop/NavTop2";
import List from "./List/List";

const Chatting = () => {
  return (
    <div className="chatting">
      <div className="containerd">
        <div className="row">
          <div className="col">
            <div className="row">
              <div className="col-lg-3 one">
                <NavTop />
                <div className="form-group has-search pt-3">
          <span className="fa fa-search form-control-feedback"></span>
          <input
            type="text"
            style={{ border: "none" }}
            className="form-control shadow-none"
            placeholder="Search Your Contact . . ."
          />
        </div>
              </div>
              <div className="col-lg two">
                <NavTop2 />
              </div>
            </div>
            <div className="row">
              <div className="col-lg-3 three">
                  <List/>
                {/* <NavTop /> */}
              </div>
              <div className="col-lg four">
                {/* <NavTop2 /> */}
              </div>
            </div>
            <div className="row">
              <div className="col-lg-3 five">
                {/* <NavTop /> */}
              </div>
              <div className="col-lg six">
                {/* <NavTop2 /> */}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Chatting;
